O texto aprovado na madrugada substitui o Projeto de Lei 2162/23. Este substitutivo determina que os crimes de tentativa de acabar com o Estado Democrático de Direito e de golpe de Estado, quando praticados no mesmo contexto, implicarão o uso da pena mais grave em vez da soma de ambas as penas.

O texto original previa anistia a todos os envolvidos nos atos de 8 de janeiro e dos acusados dos quatro grupos relacionados à tentativa de golpe de Estado julgados pelo Supremo Tribunal Federal (STF). Este artigo (anistia), contudo, foi retirado do projeto.

Se virar lei, a nova forma de soma de penas deve beneficiar todos os condenados da tentativa de golpe de Estado, como aqueles do grupo principal:

Jair Bolsonaro, ex-presidente da República;
Almir Garnier, ex-comandante da Marinha;
Paulo Sérgio Nogueira, ex-ministro da Defesa;
Walter Braga Netto, ex-ministro da Casa Civil;
Augusto Heleno, ex-chefe do Gabinete de Segurança Institucional (GSI);
Anderson Torres, ex-ministro da Justiça; e
Alexandre Ramagem, deputado federal.

Esse grupo foi condenado a penas que variam de 16 anos a 24 anos em regime fechado pela 1ª Turma do Supremo Tribunal Federal (STF), em caráter definitivo, em 25 de novembro deste ano. Parlamentares da oposição preveem, para o ex-presidente Jair Bolsonaro, que o total da redução pode levar ao cumprimento de 2 anos e 4 meses em regime fechado em vez dos 7 anos e 8 meses. A conta final, no entanto, será definida pelo Supremo.

Para os crimes de tentativa de abolição do Estado Democrático de Direito e de tentativa de golpe de Estado, quando praticados em contexto de multidão, como no caso dos participantes dos atos de 8 de janeiro de 2023, nas sedes dos três Poderes, em Brasília, o texto reduz a pena de 1/3 a 2/3, desde que o agente não tenha financiado o ato ou exercido papel de liderança.

Fonte: Agência Câmara de Notícias

Segundo o líder do PL na Câmara, Sóstenes Cavalcante (RJ), “não vamos desistir da anistia, mas neste momento é o degrau que nós temos para avançar".
